import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="Topbar">
          <svg viewBox="10 0 50 80">
            <text y="50">Welcome to iDogs</text>
          </svg>
          <div class="menuItem"/>
          <div class="menuItem"/>
        </div>
        <div class="mainContainer">
          <div class="Content"></div>
        </div>
      </header>
    </div>
  );
}

export default App;
